INSERT INTO t_product_category (id, uuid, product_lv_1_code, product_lv_1_name, product_lv_2_code, product_lv_2_name, product_lv_3_code, product_lv_3_name, pre_process_interface_url, post_process_interface_url, pre_process_script, status, script_md_5_version, date_field_one, date_field_two, date_field_three, long_field_one, long_field_two, long_field_three, string_field_one, string_field_two, string_field_three, decimal_field_one, decimal_field_two, decimal_field_three, delay_task_config_uuid) VALUES (1, 'e5b170ac-2af6-11e7-952e-ba77244e1da4', 'zhongan', '众安保险', 'modify-repaymentPlan', '变更还款计划', 'SXH-DeferredPayment', '随心还-延期还款', 'modify-repaymentPlan/zhongan/SXH-DeferredPayment', '/api/modify', 'public boolean evaluate(FinancialContractSnapshot financialContractSnapshot, ContractSnapshot contractSnapshot,\r\n			List<PaymentPlanSnapshot> assetSetSnapshotList, Map<String, String> parameters,\r\n			Map<String, String> postRequest) {\r\n		// 仅支持佰仟信贷合同\r\n		if (!financialContractSnapshot.isAllowFreewheelingRepayment()) {\r\n			postRequest.put("errorMsg", "信托合同不支持随心还");\r\n			return false;\r\n		}\r\n		try {\r\n			if (CollectionUtils.isEmpty(assetSetSnapshotList)) {\r\n				postRequest.put("errorMsg", "assetSetSnapshotList is Empty");\r\n				return false;\r\n			}\r\n			String requestData = (String) parameters.getOrDefault("requestData","");\r\n			List<RepaymentPlanModifyRequestDataModel> models = JsonUtils.parseArray(requestData,\r\n					RepaymentPlanModifyRequestDataModel.class);\r\n			if (CollectionUtils.isEmpty(models) || models.size() != assetSetSnapshotList.size()) {\r\n				postRequest.put("errorMsg", "还款计划数不匹配");\r\n				return false;\r\n			}\r\n			int globalMonDelta = 0;\r\n			for (int i = 0; i < assetSetSnapshotList.size(); i++) {\r\n				PaymentPlanSnapshot assetSetSnapshot = (PaymentPlanSnapshot)assetSetSnapshotList.get(i);\r\n				RepaymentPlanModifyRequestDataModel modifyRequestDataModel = (RepaymentPlanModifyRequestDataModel)models.get(i);\r\n				String asset_interest_principal_fingerPrint = modifyRequestDataModel\r\n						.asset_interest_principal_fingerPrint();\r\n				if (!assetSetSnapshot\r\n						.check_asset_interest_principal_fingerPrint(asset_interest_principal_fingerPrint)) {\r\n					postRequest.put("errorMsg", "还款计划基础费用不匹配");\r\n					return false;\r\n				}\r\n\r\n				if (assetSetSnapshot.is_immutable()) {\r\n					postRequest.put("errorMsg", "还款计划不可变更");\r\n					return false;\r\n				}\r\n\r\n				// 还款当日不允许变更\r\n				if (assetSetSnapshot.is_today_repayment_plan()) {\r\n					postRequest.put("errorMsg", "还款当日不允许变更");\r\n					return false;\r\n				}\r\n\r\n				PaymentPlanExtraChargeSnapshot assetSetExtraChargeSnapshot = assetSetSnapshot\r\n						.getAssetSetExtraChargeSnapshot();\r\n				if (null == assetSetExtraChargeSnapshot) {\r\n					postRequest.put("errorMsg", "assetSetExtraChargeSnapshot is null");\r\n					return false;\r\n				}\r\n\r\n				String assetExtraFeeFingerPrint = modifyRequestDataModel.assetExtraFeeFingerPrint();\r\n				if (!assetSetExtraChargeSnapshot.check_assetExtraFeeFingerPrint(assetExtraFeeFingerPrint)) {\r\n					postRequest.put("errorMsg", "还款计划其他费用不匹配");\r\n					return false;\r\n				}\r\n\r\n				// 延期还款仅仅变更月份\r\n				Date assetRecycleDate = assetSetSnapshot.getAssetRecycleDate();\r\n				Date model_date = modifyRequestDataModel.getDate();\r\n				int snapshot_day = DateUtils.day(assetRecycleDate);\r\n				int model_day = DateUtils.day(model_date);\r\n				if (snapshot_day != model_day) {\r\n					postRequest.put("errorMsg", "延期还款仅可变更月份");\r\n					return false;\r\n				}\r\n				// FIXME 还款日为29/30/31日时不得延期\r\n				if (Arrays.asList(29, 30, 31).contains(model_day)) {\r\n					postRequest.put("errorMsg", "还款日为29/30/31日时不得延期");\r\n					return false;\r\n				}\r\n\r\n				Date addOneMonth = DateUtils.addMonths(assetRecycleDate, 1);\r\n				boolean one_month_late = DateUtils.isSameMonth(addOneMonth, model_date);\r\n				Date addTwoMonths = DateUtils.addMonths(assetRecycleDate, 2);\r\n				boolean two_months_late = DateUtils.isSameMonth(addTwoMonths, model_date);\r\n\r\n				if (!one_month_late && !two_months_late) {\r\n					postRequest.put("errorMsg", "延期还款月份变更在两个月内");\r\n					return false;\r\n				}\r\n				int monDelta = one_month_late ? 1 : 2;\r\n				// 月份变化\r\n				if (globalMonDelta == 0) {\r\n					globalMonDelta = monDelta;\r\n					continue;\r\n				}\r\n				// 月份变化量相同\r\n				if (globalMonDelta != monDelta) {\r\n					postRequest.put("errorMsg", "月份变化量必须相同");\r\n					return false;\r\n				}\r\n			}\r\n\r\n			// 校验完成填写post参数\r\n			postRequest.putAll(parameters);\r\n			postRequest.put("fn", "200001");\r\n			postRequest.put("requestReason", RepaymentPlanModifyReason.REASON_4.getOrdinal() + "");\r\n\r\n			return true;\r\n		} catch (Exception e) {\r\n			e.printStackTrace();\r\n			return false;\r\n		}\r\n	}', 1, '24609b78-2b08-11e7-952e-ba77244e2da6', NULL, NULL, NULL, NULL, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO t_product_category (id, uuid, product_lv_1_code, product_lv_1_name, product_lv_2_code, product_lv_2_name, product_lv_3_code, product_lv_3_name, pre_process_interface_url, post_process_interface_url, pre_process_script, status, script_md_5_version, date_field_one, date_field_two, date_field_three, long_field_one, long_field_two, long_field_three, string_field_one, string_field_two, string_field_three, decimal_field_one, decimal_field_two, decimal_field_three, delay_task_config_uuid) VALUES (2, 'e5b4c784-2af6-11e7-952e-ba77244e1da4', 'zhongan', '众安保险', 'modify-repaymentPlan', '变更还款计划', 'SXH-ChangeRepaymentDate', '随心还-变更还款日期', 'modify-repaymentPlan/zhongan/SXH-ChangeRepaymentDate', '/api/modify', 'public boolean evaluate(FinancialContractSnapshot financialContractSnapshot, ContractSnapshot contractSnapshot,\r\n			List<PaymentPlanSnapshot> assetSetSnapshotList, Map<String, String> parameters,\r\n			Map<String, String> postRequest) {\r\n		// 仅支持佰仟信贷合同\r\n		if (!financialContractSnapshot.isAllowFreewheelingRepayment()) {\r\n			postRequest.put("errorMsg", "信托合同不支持随心还");\r\n			return false;\r\n		}\r\n		try {\r\n			if (CollectionUtils.isEmpty(assetSetSnapshotList)) {\r\n				postRequest.put("errorMsg", "assetSetSnapshotList is Empty");\r\n				return false;\r\n			}\r\n			String requestData = (String) parameters.getOrDefault("requestData", "");\r\n			List<RepaymentPlanModifyRequestDataModel> models = JsonUtils.parseArray(requestData,\r\n					RepaymentPlanModifyRequestDataModel.class);\r\n			if (CollectionUtils.isEmpty(models) || models.size() != assetSetSnapshotList.size()) {\r\n				postRequest.put("errorMsg", "还款计划数不匹配");\r\n				return false;\r\n			}\r\n			int globalDayDelta = 0;\r\n			for (int i = 0; i < assetSetSnapshotList.size(); i++) {\r\n				PaymentPlanSnapshot assetSetSnapshot = (PaymentPlanSnapshot) assetSetSnapshotList.get(i);\r\n				RepaymentPlanModifyRequestDataModel modifyRequestDataModel = (RepaymentPlanModifyRequestDataModel) models\r\n						.get(i);\r\n				String asset_interest_principal_fingerPrint = modifyRequestDataModel\r\n						.asset_interest_principal_fingerPrint();\r\n				if (!assetSetSnapshot\r\n						.check_asset_interest_principal_fingerPrint(asset_interest_principal_fingerPrint)) {\r\n					postRequest.put("errorMsg", "还款计划基础费用不匹配");\r\n					return false;\r\n				}\r\n\r\n				if (assetSetSnapshot.is_immutable()) {\r\n					postRequest.put("errorMsg", "还款计划不可变更");\r\n					return false;\r\n				}\r\n\r\n				// 还款当日不允许变更\r\n				if (assetSetSnapshot.is_today_repayment_plan()) {\r\n					postRequest.put("errorMsg", "还款当日不允许变更");\r\n					return false;\r\n				}\r\n				PaymentPlanExtraChargeSnapshot assetSetExtraChargeSnapshot = assetSetSnapshot\r\n						.getAssetSetExtraChargeSnapshot();\r\n				if (null == assetSetExtraChargeSnapshot) {\r\n					postRequest.put("errorMsg", "assetSetExtraChargeSnapshot is null");\r\n					return false;\r\n				}\r\n				String assetExtraFeeFingerPrint = modifyRequestDataModel.assetExtraFeeFingerPrint();\r\n				if (!assetSetExtraChargeSnapshot.check_assetExtraFeeFingerPrint(assetExtraFeeFingerPrint)) {\r\n					postRequest.put("errorMsg", "还款计划其他费用不匹配");\r\n					return false;\r\n				}\r\n\r\n				Date assetRecycleDate = assetSetSnapshot.getAssetRecycleDate();\r\n				Date model_date = modifyRequestDataModel.getDate();\r\n				int snapshot_month = DateUtils.month(assetRecycleDate);\r\n				int model_month = DateUtils.month(model_date);\r\n				if (snapshot_month != model_month) {\r\n					postRequest.put("errorMsg", "变更还款日期仅在本月内变更");\r\n					return false;\r\n				}\r\n\r\n				int dayDelta = DateUtils.compareTwoDatesOnDay(model_date, assetRecycleDate);\r\n				// 日期变化\r\n				if (globalDayDelta == 0) {\r\n					globalDayDelta = dayDelta;\r\n					if (globalDayDelta <= 0) {\r\n						return false;\r\n					}\r\n					continue;\r\n				}\r\n				// 日期变化量相同\r\n				if (globalDayDelta != dayDelta) {\r\n					postRequest.put("errorMsg", "日期变化量必须相同");\r\n					return false;\r\n				}\r\n			}\r\n\r\n			// 校验完成填写post参数\r\n			postRequest.putAll(parameters);\r\n			postRequest.put("fn", "200001");\r\n			postRequest.put("requestReason", RepaymentPlanModifyReason.REASON_5.getOrdinal() + "");\r\n\r\n			return true;\r\n		} catch (Exception e) {\r\n			e.printStackTrace();\r\n			return false;\r\n		}\r\n	}', 1, 'e5b4c7ac-2af6-11e7-952e-ba77244e2da4', NULL, NULL, NULL, NULL, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL);
