difyRequestDataModel.assetFingerPrint();\r\n				if (!assetSetSnapshot.checkAssetFingerPrint(asset_interest_principal_fingerPrint)) {\r\n					postRequest.put("errorMsg", "还款计划基础费用不匹配");\r\n					return false;\r\n				}\r\n				if (assetSetSnapshot.is_immutable()) {\r\n					postRequest.put("errorMsg", "还款计划不可变更");\r\n					return false;\r\n				}\r\n				// 还款当日不允许变更\r\n				if (assetSetSnapshot.is_today_repayment_plan()) {\r\n					postRequest.put("errorMsg", "还款当日不允许变更");\r\n					return false;\r\n				}\r\n			}\r\n\r\n			// 校验完成填写post参数\r\n			postRequest.putAll(parameters);\r\n			postRequest.put("fn", "200001");\r\n			postRequest.put("requestReason", RepaymentPlanModifyReason.REASON_7.getOrdinal() + "");\r\n\r\n			return true;\r\n		} catch (Exception e) {\r\n			e.printStackTrace();\r\n			return false;\r\n		}\r\n	}', 1, 'e5b5e95c-2af6-11e7-952e-ba77244e2da4', NULL, NULL, NULL, NULL, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO t_product_category (id, uuid, product_lv_1_code, product_lv_1_name, product_lv_2_code, product_lv_2_name, product_lv_3_code, product_lv_3_name, pre_process_interface_url, post_process_interface_url, pre_process_script, status, script_md_5_version, date_field_one, date_field_two, date_field_three, long_field_one, long_field_two, long_field_three, string_field_one, string_field_two, string_field_three, decimal_field_one, decimal_field_two, decimal_field_three, delay_task_config_uuid) VALUES (5, 'e5b637ea-2af6-11e7-952e-ba77244e1da4', 'zhongan', '众安保险', 'modify-repaymentPlan', '变更还款计划', 'Prepayment', '佰仟提前还款', 'modify-repaymentPlan/zhongan/Prepayment', '/api/modify', 'public boolean evaluate(FinancialContractSnapshot financialContractSnapshot, ContractSnapshot contractSnapshot,\r\n			List<PaymentPlanSnapshot> assetSetSnapshotList, Map<String, String> parameters,\r\n			Map<String, String> postRequest) {\r\n		// 仅支持佰仟信贷合同\r\n		if (!financialContractSnapshot.isAllowFreewheelingRepayment()) {\r\n			postRequest.put("errorMsg", "信托合同不支持随心还");\r\n			return false;\r\n		}\r\n		try {\r\n			if (CollectionUtils.isEmpty(assetSetSnapshotList)) {\r\n				postRequest.put("errorMsg", "assetSetSnapshotList is Empty");\r\n				return false;\r\n			}\r\n			for (PaymentPlanSnapshot assetSetSnapshot : assetSetSnapshotList) {\r\n				if (assetSetSnapshot.is_immutable()) {\r\n					postRequest.put("errorMsg", "还款计划不可变更");\r\n					return false;\r\n				}\r\n			}\r\n\r\n			// 校验完成填写post参数\r\n			postRequest.putAll(parameters);\r\n			postRequest.put("fn", "200001");\r\n			postRequest.put("requestReason", RepaymentPlanModifyReason.REASON_8.getOrdinal() + "");\r\n\r\n			return true;\r\n		} catch (Exception e) {\r\n			e.printStackTrace();\r\n			return false;\r\n		}\r\n	}', 1, 'e5b63808-2af6-11e7-952e-ba77244e2da4', NULL, NULL, NULL, NULL, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO t_product_category (id, uuid, product_lv_1_code, product_lv_1_name, product_lv_2_code, product_lv_2_name, product_lv_3_code, product_lv_3_name, pre_process_interface_url, post_process_interface_url, pre_process_script, status, script_md_5_version, date_field_one, date_field_two, date_field_three, long_field_one, long_field_two, long_field_three, string_field_one, string_field_two, string_field_three, decimal_field_one, decimal_field_two, decimal_field_three, delay_task_config_uuid) VALUES (6, 'e5b761b0-2af6-11e7-952e-ba77244e1da4', 'zhongan', '众安保险', 'modify-repaymentPlan', '变更还款计划', 'Refunds', '佰仟退货', 'modify-repaymentPlan/zhongan/Refunds', '/api/modify', 'public boolean evaluate(FinancialContractSnapshot financialContractSnapshot, ContractSnapshot contractSnapshot,\r\n			List<PaymentPlanSnapshot> assetSetSnapshotList, Map<String, String> parameters,\r\n			Map<String, String> postRequest) {\r\n		// 仅支持佰仟信贷合同\r\n		if (!financialContractSnapshot.isAllowFreewheelingRepayment()) {\r\n			postRequest.put("errorMsg", "信托合同不支持随心还");\r\n			return false;\r\n		}\r\n		try {\r\n			if (CollectionUtils.isEmpty(assetSetSnapshotList)) {\r\n				return false;\r\n			}\r\n			String requestData = (String)parameters.getOrDefault("requestData", "");\r\n			List<RepaymentPlanModifyRequestDataModel> models = JsonUtils.parseArray(requestData,\r\n					RepaymentPlanModifyRequestDataModel.class);\r\n			BigDecimal assetPrincipalAmount = BigDecimal.ZERO;\r\n			// 变更后，只剩一期还款计划\r\n			if (models.size() != 1) {\r\n				postRequest.put("errorMsg", "退货后还款计划只可剩余一期");\r\n				return false;\r\n			}\r\n			boolean isFirstPeriodMutable = false;\r\n			for (PaymentPlanSnapshot assetSetSnapshot : assetSetSnapshotList) {\r\n				assetPrincipalAmount = assetPrincipalAmount.add(assetSetSnapshot.getAssetPrincipalValue());\r\n				// 对第一期进行判断\r\n				if (1 == assetSetSnapshot.getCurrentPeriod()) {\r\n					if (assetSetSnapshot.is_immutable()) {\r\n						postRequest.put("errorMsg", "还款计划不可变更");\r\n						return false;\r\n					}\r\n					// 还款当日不允许变更\r\n					if (assetSetSnapshot.is_today_repayment_plan()) {\r\n						postRequest.put("errorMsg", "还款当日不允许变更");\r\n						return false;\r\n					}\r\n					isFirstPeriodMutable = true;\r\n				}\r\n			}\r\n			// 第一期判断未通过则判定失败\r\n			if(!isFirstPeriodMutable){\r\n				postRequest.put("errorMsg", "首期判定失败");\r\n				return false;\r\n			}\r\n			RepaymentPlanModifyRequestDataModel modifyRequestDataModel = (RepaymentPlanModifyRequestDataModel) models.get(0);\r\n			// 本金校验\r\n			if(modifyRequestDataModel.getAssetPrincipal().compareTo(assetPrincipalAmount) < 0){\r\n				postRequest.put("errorMsg", "非法本金");\r\n				return false;\r\n			}\r\n			// 校验完成填写post参数\r\n			postRequest.putAll(parameters);\r\n			postRequest.put("fn", "200001");\r\n			postRequest.put("requestReason", RepaymentPlanModifyReason.REASON_9.getOrdinal() + "");\r\n            return true;\r\n        } catch (Exception e) {\r\n			e.printStackTrace();\r\n			return false;\r\n		}\r\n	}', 1, 'e5b761d8-2af6-11e7-952e-ba77244e2da4', NULL, NULL, NULL, NULL, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL);
